export class OrganizationReservation {
  constructor(id, date, dateFrom, dateUntil, seen, approved, total, feeBilled, user, event, feeTransaction, organization) {
    this.id = id;
    this.date = date;
    this.dateFrom = dateFrom;
    this.dateUntil = dateUntil;
    this.seen = seen;
    this.approved = approved;
    this.total = total;
    this.feeBilled = feeBilled;
    this.user = user;
    this.event = event;
    this.feeTransaction = feeTransaction;
    this.organization = organization;
    this.seen = this.seen ?? false;
    this.approved = this.approved ?? false;
    this.feeBilled = this.feeBilled ?? false;
  }
}
export function getOrganizationReservationIdentifier(organizationReservation) {
  return organizationReservation.id;
}
